import{_ as t,c as A,o as r,a4 as n}from"./chunks/framework.D0jSIsaT.js";const a="/assets/img1.DMLKIi_F.png",s="/assets/img2.B3lj-obu.png",g="/assets/img3.JJRbo7v6.png",o="/assets/img4.BkF1gbzr.png",p="data:image/png;base64,",e="/assets/img6.OBq9hZTa.png",d="/assets/img7.3H48deIk.png",u=JSON.parse('{"title":"学点cmd（控制台）命令","description":"","frontmatter":{},"headers":[],"relativePath":"articles/学习笔记/杂项/学点cmd（控制台）命令.md","filePath":"articles/学习笔记/杂项/学点cmd（控制台）命令.md"}'),c={name:"articles/学习笔记/杂项/学点cmd（控制台）命令.md"},i=n('<h1 id="学点cmd-控制台-命令" tabindex="-1">学点cmd（控制台）命令 <a class="header-anchor" href="#学点cmd-控制台-命令" aria-label="Permalink to &quot;学点cmd（控制台）命令&quot;">​</a></h1><h2 id="_1-如何启动cmd" tabindex="-1">1. 如何启动cmd？ <a class="header-anchor" href="#_1-如何启动cmd" aria-label="Permalink to &quot;1. 如何启动cmd？&quot;">​</a></h2><p>可通过如下几种方式启动：</p><p>1.1 快捷键 <strong>win+r</strong> 组合，在弹出的输入框中输入 <strong>cmd</strong> ,回车即可；</p><p>1.2 在 win标旁的搜索栏键入 <strong>cmd</strong>,在搜索结果中点击即可启动，此方法可以选择以管理员身份启动cmd，适用于某些需要权限的命令；</p><p>1.3 在路径：C:\\Windows\\System32 下搜索 <strong>cmd</strong> ，找到对应的exe文件(如下图)，为其新建一个桌面快捷方式。该快捷方式也支持右键以管理员身份启动。</p><p><img src="'+a+'" alt=""></p><h2 id="_2-我能用cmd做什么" tabindex="-1">2. 我能用cmd做什么？ <a class="header-anchor" href="#_2-我能用cmd做什么" aria-label="Permalink to &quot;2. 我能用cmd做什么？&quot;">​</a></h2><p>命令行能做的事很多，从各种系统设置项的更改，到文件的读写、脚本的执行、编译器的启动...你能想到的不能想到的都能做。</p><h2 id="_3-为什么要用cmd" tabindex="-1">3. 为什么要用cmd？ <a class="header-anchor" href="#_3-为什么要用cmd" aria-label="Permalink to &quot;3. 为什么要用cmd？&quot;">​</a></h2><p>原因可以有很多：启动快、反馈快、部分交互式软件没有提供gui，只能通过命令行启动等。</p><h2 id="_4-一点基础的cmd命令" tabindex="-1">4. 一点基础的cmd命令 <a class="header-anchor" href="#_4-一点基础的cmd命令" aria-label="Permalink to &quot;4. 一点基础的cmd命令&quot;">​</a></h2><p>4.1 <strong>盘符的切换</strong> cmd 启动时默认路径为：C:\\Users\\Administrator\\ ， 也就是位于C盘下。可以理解为操作者本人此时正处在该文件夹下。如果要进入D盘，可以输入 <strong>D:</strong> 然后回车。此处的盘符字母大小写均可。</p><p><img src="'+s+'" alt=""></p><p>4.2 <strong>目录下文件的查看</strong></p><p>要查看当前目录下有哪些文件，输入 <strong>dir</strong> 回车即可，如果要查看指定目录下的文件，则使用命令 <strong>dir 指定目录名</strong> 。</p><p><img src="'+g+'" alt=""></p><p>使用命令 <strong>tree /f</strong> 查看当前文件夹下所有文件夹层级结构：</p><p><img src="'+o+'" alt=""></p><p>4.3 <strong>目录的跳转</strong></p><p>要进行目录的跳转，首先要明白目录的结构。一个目录由以下几个部分组成：.(代表当前目录)， ..(代表上一级目录)，其它目录。使用 <strong>cd</strong> 命令可以在各个目录间跳转（要实现不同盘符中的跳转需要先切换盘符）。</p><p><img src="'+p+'" alt=""></p><p>4.4 <strong>目录的创建和删除</strong></p><p>使用命令 <strong>mkdir xxx</strong> 即可在当前目录下创建名为xxx的文件夹。</p><p><img src="'+e+'" alt=""></p><p>在下图中，我们使用 <strong>tree /f</strong> 命令查看当前目录结构。其中02和03文件夹下各有一个文件，04文件是空的。</p><p>使用 <strong>rmdir xxx</strong> 可以直接删除空文件夹，即图中的04文件夹。但是对于非空的文件夹直接使用该命令会拒绝执行并提示文件夹非空。 我们使用 <strong>del xxx</strong> 命令删除名为xxx的文件，然后再执行删除文件夹操作，成功。 上面的方法比较麻烦，实际上，也可以使用 <strong>rmdir /s xxx</strong> 命令来删除非空文件夹。</p><p><img src="'+d+'" alt=""></p><h1 id="tips" tabindex="-1">Tips <a class="header-anchor" href="#tips" aria-label="Permalink to &quot;Tips&quot;">​</a></h1><ol><li>使用键盘上的方向键（向上、向下）可以在历史输入的各条指令之间来回切换，节省时间。</li><li>输入目录名称时，如果名称剩余部分唯一（如当前目录下有1234.txt, 1245.txt，此时输入123，则剩余部分必然是4.txt），按下tab键可以自动补齐剩余部分。</li><li>部分指令执行时间较长，如果希望中止当前指令，可以按 <strong>ctrl+c</strong> （卡住的话多按两遍）。</li><li>要在命令行中复制粘贴文本，应使用鼠标右键而非 <strong>ctrl，c，v</strong> 的组合。即选中想复制的文本，点击右键即将其复制到剪贴板，再次点击右键即粘贴到命令行中。</li></ol>',30),m=[i];function l(E,B,I,f,C,b){return r(),A("div",null,m)}const x=t(c,[["render",l]]);export{u as __pageData,x as default};
